import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the Bookmarks navigation item to be visible
    await page.waitForSelector('.nav-item[data-view="bookmarks"]');

    // Click on the Bookmarks navigation item
    await page.click('.nav-item[data-view="bookmarks"]');

    // Wait for the Bookmarks view to load (adjust the selector as necessary)
    await page.waitForSelector('#bookmarks-view'); // assuming bookmarks view has an ID or class

    // Take a screenshot after clicking on Bookmarks
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_bookmarks_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_bookmarks_view.png'));

    // Extract data to verify that bookmarks are loaded (adjust according to your implementation)
    const bookmarksData = await page.evaluate(() => {
      const bookmarks = [];
      document.querySelectorAll('.bookmark-item').forEach(item => {
        bookmarks.push({
          title: item.querySelector('.bookmark-title').innerText, // adjust selectors as necessary
          link: item.querySelector('a').href // adjust selectors as necessary
        });
      });
      return bookmarks;
    });

    return {
      success: true,
      action: "Clicked on Bookmarks navigation item and viewed bookmarked threads",
      extractedData: { bookmarks: bookmarksData },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
